import React, { Component } from 'react'

import teacheravatar from "./img/teacher_avatar.png"
import SearchTeacher from '../../../../../components/content/SearchTeacher'
import MessageCar from '../../../../../components/content/MessageCar'

export default class Teachers extends Component {
  render() {
    return (
      <div>
        {/* 班级信息 */}
        <div className='class-detail-message' >

          {/* 科任老师筛选组件 */}
          <SearchTeacher></SearchTeacher>

          {/* 科任老师 */}
          <MessageCar></MessageCar>

          

         
          

        


       

          <div className="detail-message">
            <img src={teacheravatar} alt="" />
            <div className='teachename'><i>柳云</i></div>
            <div className='subjects-node'  >
              <div className='admi'><i>管理员</i></div>
              <div className='subjects'><i>英语老师</i></div>
            </div>
          </div>
        </div>

      </div>
    )
  }
}
